                new ImportVariable("varName", "var1"),
                new ImportVariable("varType", "String"),
                new ImportVariable("varValue", "abc"),
                new ImportVariable("varName", "var2"),
                new ImportVariable("varType", "Number"),
                new ImportVariable("varValue", "123")
